const fs = require('fs');
const path = require('path');

// Excel date serial to JS Date
function excelDateToJSDate(serial) {
  const utc_days = Math.floor(serial - 25569);
  const utc_value = utc_days * 86400;
  const date_info = new Date(utc_value * 1000);
  return new Date(date_info.getFullYear(), date_info.getMonth(), date_info.getDate());
}

// Format date as "Month Day, Year"
function formatDate(date) {
  const months = ['January', 'February', 'March', 'April', 'May', 'June', 
                  'July', 'August', 'September', 'October', 'November', 'December'];
  return `${months[date.getMonth()]} ${date.getDate()}, ${date.getFullYear()}`;
}

// Read the template
const template = fs.readFileSync('/job/operating_system/LEASE_RENT_HOUSE_TEMPLATE.html', 'utf-8');

// Contract start date (Excel serial 46082)
const leaseStartDate = excelDateToJSDate(46082);

// Replace all placeholders
let rendered = template
  .replace(/\{\{TENANT_NAME\}\}/g, 'Christian Lachausse')
  .replace(/\{\{PROPERTY_ADDRESS\}\}/g, '111 E Main Street, Celina, TX 75009')
  .replace(/\{\{MONTHLY_RENT\}\}/g, '$1,800.00')
  .replace(/\{\{LEASE_START\}\}/g, formatDate(leaseStartDate))
  .replace(/\{\{SECURITY_DEPOSIT\}\}/g, '$1,800.00')
  .replace(/\{\{UTILITIES_SECTION\}\}/g, 
    '<p><strong>Utilities:</strong> Tenant will be invoiced for utility bills each month after we receive them.</p>')
  .replace(/\{\{CUSTOM_TERMS\}\}/g, 
    '<p><strong>Lawn Maintenance:</strong> Mowing of yard is included in the base rent.</p>\n' +
    '<p><strong>Lease Term:</strong> This is a month-to-month lease agreement.</p>')
  .replace(/\{\{DATE\}\}/g, 'February 17, 2026')
  .replace(/\{\{CONTACT_EMAIL\}\}/g, 'Sloan@tjmfuneral.com')
  .replace(/\{\{CONTACT_PHONE\}\}/g, '(972) 632-2787');

// Write rendered HTML
fs.writeFileSync('/job/tmp/lease.html', rendered);
console.log('HTML template rendered successfully');

const puppeteer = require('puppeteer');
const fs = require('fs');

(async () => {
  const browser = await puppeteer.launch({ 
    headless: 'new', 
    args: ['--no-sandbox', '--disable-setuid-sandbox'] 
  });
  const page = await browser.newPage();
  const html = fs.readFileSync('/job/tmp/lease.html', 'utf-8');
  await page.setContent(html, { waitUntil: 'networkidle0' });
  await page.pdf({
    path: '/job/tmp/Lease_Agreement_Christian_Lachausse_111_E_Main_St.pdf',
    format: 'Letter',
    printBackground: true
  });
  await browser.close();
  console.log('PDF generated successfully');
})();
